import React, { Component } from 'react';


class Frist extends Component {
    constructor(props) {
        super(props)

        this.state = {
            login: false
        }
    }

    render() {
        let massage
        if (this.state.login) {
            massage = <div>navid</div>
        } else {
            massage = <div>nabizada</div>
        }

    }
}

export default Frist;
